    a,

      left: 122px;
      text-shadow: 2px 2px 6px #a9a9a9
    }

    .sticky {
      padding: 8px;
      box-shadow: -4px 4px 20px rgba(0, 0, 0, 0.66);
      position: fixed;
      top: 10%;
      right: 0;
      width: 1em;
      font-size: 40px;
      background: white;
      border-bottom-left-radius: 10px;
      border-top-left-radius: 10px;
    }

    footer {
      position: fixed;
      bottom: 0;
      width: 100%;
      padding-top: 4px;
      z-index: 1000;
      text-align: center;
    }

      .blogname {
        font-size: 3em;

    @media (min-width: 1400px) {

      article

        width: 1200px;
